import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import ChatRoom from './components/ChatRoom';
import './App.css';

function App() {
  return (
      <Router basename="/chat">
        <div className="App">
          <Switch>
            <Route exact path="/" component={ChatRoom} />
          </Switch>
        </div>
      </Router>
  );
}

export default App;
